import React, { Component } from "react";
import "./components.css";
import BackButton from "./components/BackButton";
import TopNav from "./components/TopNav";
import BottomNav from "./components/BottomNav";
import AddIcon from "@material-ui/icons/Add";
import Button from "@material-ui/core/Button";

import HouseIcon from "@material-ui/icons/House";
import WorkIcon from "@material-ui/icons/Work";
import SchoolIcon from "@material-ui/icons/School";
import PeopleAltIcon from "@material-ui/icons/PeopleAlt";

class PageGoalCategories extends Component {
  state = {};
  render() {
    return (
      <div>
        <TopNav></TopNav>
        <BackButton></BackButton>
        <div className="body">
          <div className="goal-category-button-container">
            <Button
              size="large"
              variant="outlined"
              color="default"
              startIcon={<AddIcon />}
            >
              {"Health"}
            </Button>
            <Button
              size="large"
              variant="outlined"
              color="default"
              startIcon={<HouseIcon />}
            >
              {"Housing"}
            </Button>
            <Button
              size="large"
              variant="outlined"
              color="default"
              startIcon={<WorkIcon />}
            >
              {"Job"}
            </Button>
            <Button
              size="large"
              variant="outlined"
              color="default"
              startIcon={<SchoolIcon />}
            >
              {"Education"}
            </Button>
            <Button
              size="large"
              variant="outlined"
              color="default"
              startIcon={<PeopleAltIcon />}
            >
              {"Children"}
            </Button>
            <Button
              size="large"
              variant="outlined"
              color="default"
              startIcon={<AddIcon />}
            >
              {"Custom"}
            </Button>
          </div>
        </div>
        <BottomNav></BottomNav>
      </div>
    );
  }
}

export default PageGoalCategories;
